svg.script:

var circle = document.getElementsByTagName('ellipse');
var i = 0;

function load(){
  var loadWhite = setInterval(function(){whiteCircles();},15);
  function whiteCircles(){
    if(i > 183){
      clearInterval(loadWhite);
      i = 0;
      unLoad();
    }
    else{
      circle[i].style.fill="#F4F4F4";
      i ++;
    };
  };
};

function unLoad(){
  var loadBlack = setInterval(function(){blackCircles();},15);
  function blackCircles(){
    if(i > 183){
      clearInterval(loadBlack);
      i=0;
      load();
    }
    else{
      circle[i].style.fill="#0E0E0E";
      i ++;
    };
  };
};

load();
